import { Component, OnInit } from '@angular/core';
import { FaceSnap } from './models/face-snap.model';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent implements OnInit {

  ShepSnap!: FaceSnap;
  ThaneSnap!: FaceSnap;
  ShepSnap!: FaceSnap;


  ngOnInit() {
    this.ShepSnap=new FaceSnap(
      'Shepard',
      'Normandy\'s Commander',
      'https://i.pinimg.com/564x/57/c1/71/57c171b8fd242ca1d6ced472250b3ef4.jpg',
      new Date(),
      0
    )
    this.ThaneSnap=new FaceSnap(
      'Thane Krios',
      'Normandy\'s Commander',
      'https://i.pinimg.com/564x/57/c1/71/57c171b8fd242ca1d6ced472250b3ef4.jpg',
      new Date(),
      0
    )


  }
}
